import React from 'react';
import MainBar from './MainBar';
import Search from './Search';
import CardList from './CardList';
import {
  Container,
  Grid
} from '@material-ui/core';

export default function Products({ data }) {
  return (
    <div>
      <MainBar hasLogo />
      <Search />
      <Container component="main" maxWidth="lg">
        <CardList data={data} />
      </Container>
    </div>
  );
}
